import { React, Component } from 'react';

class MyComponent extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            onPage: true,
        }
    }

    componentDidMount() {
        console.log("Hello World!")
    }

    render() {
        return(
            <div>
                <p>Hello World!</p>
                <p>this.props.prop</p>
            </div>
        );
    }
}

export default MyComponent
